/* eslint-disable react/jsx-pascal-case */
import React from "react";
import { useNavigate } from "react-router-dom";
import MainTitle from "../titles/MainTitle";
import { Link } from "react-router-dom";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faUser } from "@fortawesome/free-solid-svg-icons";
import { faPowerOff } from "@fortawesome/free-solid-svg-icons";
import { faHouse } from "@fortawesome/free-solid-svg-icons";
import Button from "../button/Button";

const Header = (props) => {
  const homeUrl = "/home/";
  const profilUrl = "/profil/";
  const navigate = useNavigate();
  function redirectUrl() {
    navigate("/connexion/");
  }

  return (
    <div className="d-flex flex-row justify-content-evenly align-items-center container-fluid bg-light p-3">
      <MainTitle />
      <div className="d-flex fs-5 ">
        <div className="me-3">
          <FontAwesomeIcon icon={faHouse} className="icon"></FontAwesomeIcon>
          <Link to={homeUrl} className="ms-1">Home</Link>
        </div>

        <div className="me-3 fs-5">
          <FontAwesomeIcon icon={faUser} className="icon"></FontAwesomeIcon>
          <Link to={profilUrl} className="">Profil</Link>
        </div>

        <div className="">
          <Button
            className=""
            value="Deconnexion"
            onClick={redirectUrl}
            Link
            to={"/connexion"}
          >
            {" "}
            <FontAwesomeIcon
              icon={faPowerOff}
              className="icon"
            ></FontAwesomeIcon>
          </Button>
        </div>
      </div>
    </div>
  );
};

export default Header;
